import React from 'react';
import './Announcements.css';

function card(props){
  return (
    <div class="card text-white bg-success mb-3 announcements-card">
      <img src={props.image} class="card-img-top announcements-img" alt="..."></img>
      <div class="card-header">{props.title}</div>
      <div class="card-body">
        <h5 class="card-title">{props.message}</h5>
      </div>
    </div>
  );
}

export default card;
